import { useDispatch, useSelector } from 'react-redux';
import { POSTS_LOADING_REQUEST } from '../../redux/types';

const PostCardList = () => {
    const { posts } = useSelector(state => state.post)
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch({ type: POSTS_LOADING_REQUEST });
    }, [dispatch]);

